glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif
uniform Properties{
  vec4 addColor;
  vec4 rect;
  float hidebottom;
  float isRotated;
  float amplitude;
  float angularVelocity;
  float frequency;
  float offset;
};
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
  o *= texture(texture, v_uv0);
    #if CC_USE_ALPHA_ATLAS_TEXTURE
    o.a *= texture2D(texture, v_uv0 + vec2(0, 0.5)).r;
    #endif
  #endif
  o *= v_color;
  ALPHA_TEST(o);
  o.rgb = o.rgb + addColor.rgb;
  if(hidebottom > 0.9){
    float initiaPhase = frequency * cc_time.x;
    if(isRotated>0.9){
      float x = amplitude * sin(angularVelocity * v_uv0.y + initiaPhase) + offset;
        if(v_uv0.x < rect.x+(rect.z+x)*0.5){
          if(o.a != 0.0){
            o.a = 0.1;
          }
        }else if(v_uv0.x < rect.x+(rect.z+x)*0.52){
            o = vec4(1, 1, 1, 1);
        }
    }else{
      float y = amplitude * sin(angularVelocity * v_uv0.x + initiaPhase) + offset;
        if(v_uv0.y -rect.y> (rect.w+y)*0.5){
          if(o.a != 0.0){
            o.a = 0.1;
          }
        }else if(v_uv0.y -rect.y> (rect.w+y)*0.48){
          o = vec4(1, 1, 1, 1);
        }
    }
  }
  gl_FragColor = o;
}

